import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './pages/Home';
import AllPropertiesPage from './pages/AllPropertiesPage';
import ChaletDetailPage from './pages/ChaletDetailPage';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import ContactCTA from './components/ContactCTA';

import AboutUs from './components/AboutUs';

// These pages might need to be created
const RentPage = () => <div>Rent Chalets Page</div>;
const AboutPage = () => <div>About Us Page</div>;
const ContactPage = () => <div>Contact Page</div>;
const LoginPage = () => <div>Login/Sign Up Page</div>;

function App() {
  return (
    <Router>
      <div className="App">
        <main>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/properties" element={<AllPropertiesPage />} />
            <Route path="/chalet/:id" element={<ChaletDetailPage />} />
            <Route path="/rent" element={<RentPage />} />
            <Route path="/about" element={<Home />} /> <Route path="/about" element={<AboutUs />} />
            <Route path="/contact" element={<ContactCTA />} />
            <Route path="/login" element={<LoginPage />} />
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
